import React from 'react';
import './ImageDisplay.css';

const ImageDisplay =({imageUrl,box})=>
{
	return(
	<div>
   <img id='inputimage' alt='img' src={imageUrl} width='500px' height='auto'/>
	 <div className='bounding-box' style={{top: box.topRow +532, right:box.rightCol+400, bottom: -(box.bottomRow)/2, left: box.leftCol+400}}></div>
  </div>
      );
}

export default ImageDisplay;
